import React, {Component} from 'react'
import Grid from '@material-ui/core/Grid'
import logoinsta from '../../images/images/logoinsta'

class LoginPage extends Component{
    constructor(props){
        super(props);
        this.state={}
    }

    render(){
        return(
            <div>
                <Grid container>
                    <Grid item xs={3}>
                        ababsbsb
                    </Grid>
                    <Grid item xs={6}>
                        <div>
                            <div>
                                <img src={logoinsta} width='454px'/>
                            </div>
                            <div></div>
                        </div>
                    </Grid>
                    <Grid item xs={3}>
                        abasbh
                    </Grid>
                </Grid>
            </div>
        );
    }
}

export default LoginPage
